import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  avatar: {
    width: 150,
    height: 150,
    borderRadius: 125,
    marginTop: 20
  },
  header: {
    alignItems: 'center',
    justifyContent: 'center',
  },
  name: {
    fontSize: 26,
    fontWeight: 'bold',
    marginTop: 10,
  },
  role: {
    marginBottom: 10,
  }
});

export default styles;
